import React from "react";
import { BrowserRouter, Link, Route, Switch } from "react-router-dom";

function GuideBar() {
  return (
    <div>
      <ul>
        <li>
          <Link to="/">Homepage</Link>
        </li>
        <li>
          <Link to="/classes">Courses</Link>
        </li>
        <li>
          <Link to="/mine">Mine Account</Link>
        </li>
        <li>
          <Link to="/mineaaaa">not Found</Link>
        </li>
      </ul>

      <Switch>
        <Route exact path="/" component={Home}></Route>
        <Route path="/classes" component={Classes}></Route>
        <Route path="/mine" component={Mine}></Route>
        <Route component={Notfound}></Route>
      </Switch>
    </div>
  );
}
//首页组件
function Home() {
  return <div>Home Page</div>;
}
//课程组件
function Classes() {
  return (
    <div>
      Courses
      <ul>
        <li>React</li>
        <li>Redux</li>
        <li>Java Script</li>
      </ul>
    </div>
  );
}
//我的组件
function Mine() {
  return (
    <div>
      <ul>
        <li>Account Number</li>
        <li>Password</li>
        <li></li>
      </ul>
    </div>
  );
}
//配置404组件
function Notfound() {
  return <div>404</div>;
}

export default function RouterSample() {
  return (
    <div>
      <BrowserRouter>
        <GuideBar></GuideBar>
      </BrowserRouter>
    </div>
  );
}
